import React from "react";

function PersonList() {
    const persons = [
        {
            id : 1,
            name: 'Babbi',
            skill: 'React',
            age: 28
        },
        {
            id : 2,
            name: 'Annie',
            skill: 'Angular',
            age: 27
        }
    ]
    const personList = persons.map(person =>
         <h2>I am {person.name}. I am {person.age}. I know {person.skill}</h2>
         )
    return (
        <div>
            {personList}
        </div>
    )
}
export default PersonList
